                { title: "Premium", field: "Premium_Entry", width: 80, hozAlign: "right", formatter: "money", formatterParams: { precision: 2 } },
                { title: "Status", field: "Status", width: 100, headerFilter: "input",
                    formatter: function(cell) {
                        const v = cell.getValue();
                        if (v === "OPEN") return '<span class="cell-yellow">' + v + '</span>';
                        if (v === "EXPIRED_OTM") return '<span class="cell-green">' + v + '</span>';
                        if (v === "EXPIRED_ITM") return '<span class="cell-red">' + v + '</span>';
                        return v;
                    }
                },
                { title: "Win/Loss", field: "Win_Loss", width: 80,
                    formatter: function(cell) {
                        const v = cell.getValue();
                        if (v === "WIN") return '<span class="cell-green">WIN</span>';
                        if (v === "LOSS") return '<span class="cell-red">LOSS</span>';
                        return v || "";
                    }
                },
                { title: "P&L $", field: "Actual_PnL_$", width: 90, hozAlign: "right",
                    formatter: function(cell) {
                        const v = cell.getValue();
                        if (v == null || v === "") return "";
                        const num = parseFloat(v);
                        const cls = num >= 0 ? "cell-green" : "cell-red";
                        return '<span class="' + cls + '">$' + num.toFixed(2) + '</span>';
                    }
                },
                { title: "ROI %", field: "ROI_%", width: 80, hozAlign: "right",
                    formatter: function(cell) {
                        const v = cell.getValue();
                        if (v == null || v === "") return "";
                        const num = parseFloat(v);
                        const cls = num >= 0 ? "cell-green" : "cell-red";
                        return '<span class="' + cls + '">' + num.toFixed(2) + '%</span>';
                    }
                },
                { title: "Hold Days", field: "Actual_Hold_Days", width: 80, hozAlign: "right" },
                { title: "Shield Acc", field: "Shield_Accuracy", width: 80 },
                { title: "ShieldIQ Acc", field: "ShieldIQ_Accuracy", width: 90 },
            ],
            initialSort: [{ column: "Expiration", dir: "desc" }],
        });

        // Filter handlers
        document.getElementById("filter-product").addEventListener("change", function() {
            table.setFilter("Product", "like", this.value);
        });
        document.getElementById("filter-engine").addEventListener("change", function() {
            if (this.value) table.setFilter("Engine", "=", this.value);
            else table.clearFilter("Engine");
        });
        document.getElementById("filter-status").addEventListener("change", function() {
            if (this.value) table.setFilter("Status", "=", this.value);
            else table.clearFilter("Status");
        });
    </script>
</body>
</html>
